description:
Op 11 januari 1992 zorgt een serie vreemde gebeurtenissen voor opschudding in de wereld. Een ervan is een 7-jarig meisje dat de man neerschiet die net haar ouders op brute wijze heeft vermoord. 18 jaar later wordt Sara Tobias nog steeds achtervolgd door de geest van haar moeder en de zoektocht naar de betekenis van 11:11. Deze nummers waren destijds in bloed geschreven naast haar moeders vermoorde lichaam. Met alleen haar vriend Raden als steun worstelt Sara zich door het leven. Drie plotselinge en mysterieuze moorden worden opgevolgd door een golf aan terugkerende onnatuurlijke gebeurtenissen. Gedreven door angst en een onverklaarbare drang wordt Sara richting de waarheid van de 11:11 profetie geduwd en het ultieme offer dat zij zal moeten maken...


